INSERT INTO `games` VALUES (1,'Red dead redemption 2','Игра RDR2, получившая более 175 наград и 250 высших оценок от игровых изданий, – это грандиозная история о судьбе бандита Артура Моргана и банды Ван дер Линде, бегущих от закона через всю Америку на заре современной эпохи.','2016-10-18','https://www.youtube.com/watch?v=0kqEBOZaP94','https://upload.wikimedia.org/wikipedia/ru/thumb/0/03/Red_Dead_Redemption_2_coverart.jpg/274px-Red_Dead_Redemption_2_coverart.jpg','https://www.rockstargames.com/reddeadredemption2/restricted-content/agegate/form?redirect=https%3A%2F%2Fwww.rockstargames.com%2Freddeadredemption2%2Fru&options=&locale=ru_ru',1,1),(4,'The Witcher 3','Когда в Северных королевствах бушует война, вы заключаете величайший контракт своей жизни — отыскать Дитя предназначения, живое оружие, которое может изменить облик мира.','2013-02-05','https://www.youtube.com/watch?v=A-mCKNTU_mU','https://upload.wikimedia.org/wikipedia/ru/thumb/a/a2/The_Witcher_3-_Wild_Hunt_Cover.jpg/266px-The_Witcher_3-_Wild_Hunt_Cover.jpg','https://thewitcher.com/ru/witcher3/',2,2),(5,'Warcraft 3: The Frozen Throne','The Frozen Throne открывает перед геймерами новую главу в эпической саге о Warcraft. В одиночной кампании игроки возвращаются в раздираемый войной мир Азерота. ',NULL,NULL,'https://upload.wikimedia.org/wikipedia/ru/thumb/0/04/Warcraft_III_The_Frozen_Throne_Cover.jpg/274px-Warcraft_III_The_Frozen_Throne_Cover.jpg','http://eu.blizzard.com/ru-ru/games/war3/',NULL,3),(6,'Fallout 2','Fallout 2 — это продолжение признанной всеми игры, которая вытащила жанр RPG из подземелий и поместила его в динамичное, апокалиптическое ретро-будущее.',NULL,'https://www.youtube.com/watch?v=5fr1KDYGkeo','https://upload.wikimedia.org/wikipedia/ru/thumb/4/49/Fallout2.jpg/274px-Fallout2.jpg','https://web.archive.org/web/19980710153639/http://interplay.com/fallout2/',3,4),(7,'Cyberpunk 2077','Cyberpunk 2077 — приключенческая ролевая игра, действие которой происходит в мегаполисе Найт-Сити, где власть, роскошь и модификации тела ценятся выше всего.','2012-05-30','https://www.youtube.com/watch?v=aSrFWinrkeQ','https://ru.wikipedia.org/wiki/%D0%A4%D0%B0%D0%B9%D0%BB:%D0%9E%D0%B1%D0%BB%D0%BE%D0%B6%D0%BA%D0%B0_%D0%BA%D0%BE%D0%BC%D0%BF%D1%8C%D1%8E%D1%82%D0%B5%D1%80%D0%BD%D0%BE%D0%B9_%D0%B8%D0%B3%D1%80%D1%8B_Cyberpunk_2077.jpg','https://www.cyberpunk.net/ru/ru/',4,NULL),(8,'Dark Souls II','Это уникальная ролевая игра старой школы, покорившая игроков по всему миру. Здесь вас ждут труднейшие испытания и невероятное приключение','2012-12-07','https://www.youtube.com/watch?v=U6uyuIQYlfY','https://upload.wikimedia.org/wikipedia/ru/thumb/2/22/Dark_souls_2.jpg/274px-Dark_souls_2.jpg','http://www.darksoulsii.com/us/',8,5),(9,'Grand Theft Auto V','Grand Theft Auto V для PC позволяет игрокам исследовать знаменитый мир Лос-Сантоса и округа Блэйн в разрешении до 4k и выше с частотой 60 кадров в секунду.','2011-11-02','https://www.youtube.com/watch?v=QkkoHAzjnUs','https://upload.wikimedia.org/wikipedia/ru/thumb/c/c8/GTAV_Official_Cover_Art.jpg/274px-GTAV_Official_Cover_Art.jpg','http://www.rockstargames.com/ru/',1,6),(10,'Dota 2','Ежедневно миллионы игроков по всему миру вступают в битву от лица одного из более сотни героев Dota 2. Неважно, будет это десятый или тысячный час в игре — в ней всегда есть место чему-то новому.','2010-10-13','https://www.youtube.com/watch?v=-cSFPIwMEq4','https://upload.wikimedia.org/wikipedia/ru/thumb/8/8e/%D0%9E%D0%B1%D0%BB%D0%BE%D0%B6%D0%BA%D0%B0_Dota_2.jpg/266px-%D0%9E%D0%B1%D0%BB%D0%BE%D0%B6%D0%BA%D0%B0_Dota_2.jpg','http://ru.dota2.com/',6,9),(11,'Metal Gear Solid V: The Phantom Pain','Перейдите в новую эру франшизы с передовыми технологиями, работу которых обеспечивает графический процессор Fox Engine.','2013-05-27','https://www.youtube.com/watch?v=Krc1t4HU8GI','https://upload.wikimedia.org/wikipedia/ru/thumb/8/8a/%D0%9E%D0%B1%D0%BB%D0%BE%D0%B6%D0%BA%D0%B0_Metal_Gear_Solid_V_The_Phantom_Pain.jpg/266px-%D0%9E%D0%B1%D0%BB%D0%BE%D0%B6%D0%BA%D0%B0_Metal_Gea